​​CИГНАЛ «УВАГА ВСІМ»: ЩО ТРЕБА РОБИТИ, ПОЧУВШИ ТАКИЙ СИГНАЛ

Термінова інформація про загрозу або виникнення надзвичайної ситуації передається через офіційні канали органів державної, областної та місцевої влади після переривчастого звучання електросирен, яке означає «Увага всім!».

ЩО РОБИТИ

Почувши звуки електросирен, гудки підприємств, інших сигнальних засобів (що означає “УВАГА ВСІМ”), кожен громадянин зобов’язаний:

- увімкнути телевізор на каналі місцевого віщання або зайти НА ОФІЦІЙНІ СТОРІНКИ В СОЦІАЛЬНИХ МЕРЕЖАХ ОРГАНІВ ДЕРЖАНОЇ ТА МІСЦЕВОЇ ВЛАДИ: Одеської ОДА, Одеської облради, Одеської міської ради, регіональних управлінь СБУ, Нацполіції та ДСНС;

- ознайомитись зі зверненням до населення, яке пролунає після відключення сирен, гудків тощо; 

- закрити вікна, вимкнути всі нагрівальні прилади, перекрити газову мережу, загасити печі, вимкнути світло;

- швидко одягнутися, перевірити наявність пришитих з внутрішнього боку одягу в дітей дошкільного віку записів: прізвище, ім’я, по батькові, адреса, вік, номер домашнього телефону;

- взяти індивідуальні засоби захисту та завчасно підготовлений запас продуктів і води, особисті документи, кишеньковий ліхтарик та найкоротшим шляхом прямувати до найближчого укриття. 

НАЙБЛИЖЧЕ УКРИТТЯ ЦЕ:
✔ підвал вашого чи сусіднього будинків;
✔захисні споруди коммунальної власності, які будуть відкриті після одержання сигналу;
✔паркінг;
✔ підвали найближчої школи чи садочка;
✔якщо таких укриттів поблизу немає, використовуйте нерівності рельєфу.

Увага: захисні споруди лікарень приймають тільки хворих, поранених та медичний персонал, що працює!

